        case "travel_design_revenue":
            return "בחרו מהלך הכנסה ישיר להיום, עם לקוח יעד ותמחור ברור, וקבעו שיחת סגירה."
        case "travel_design_resilience":
            return "בצעו בדיקת רציפות מלאה: חשמל, תקשורת, חלופה חוקית ללינה, ונוהל חירום."
        case "travel_design_recovery":
            return "הגדירו חלון חידוש קצר (חדשנות בטוחה) ולאחריו רפלקציה כתובה לשיפור גמישות מחשבתית."
        case "travel_design_strategy":
