        case "travel_design_emergency_command":
            return "הפעילו נוהל חירום: טריאז', ייצוב, תקשורת, הסלמה וניתוב לנקודת בטיחות."
        case "travel_design_human_problem_solving":
            return "סדרו תנאים ביולוגיים וסביבתיים (שינה, נשימה, עומס קוגניטיבי), ואז בצעו תרגיל פתרון בעיות מובנה."
        case "travel_design_tech_innovation":
            return "הריצו ניסוי חדשנות אחד דיגיטלי-פיזי עם גבולות בטיחות, מדד הצלחה, ולולאת שיפור."
        default:
            return fallback
        }
    }

    private func emergencyOverride(for text: String, prefersHebrew: Bool) -> (summary: String, nextAction: String)? {
        let lower = text.lowercased()
        let emergencySignals = [
            "emergency",
            "urgent",
            "critical",
            "crisis",
            "triage",
            "evac",
            "rescue",
            "injury",
            "bleeding",
            "unconscious",
            "no signal",
            "חירום",
            "דחוף",
            "משבר",
            "טריאז",
            "חילוץ",
            "פינוי",
            "דימום",
            "מחוסר הכרה",
        ]
        guard emergencySignals.contains(where: { lower.contains($0) }) else {
            return nil
        }

        if prefersHebrew {
            return (
                "מצב פיקוד חירום פעיל: עדיפות ראשונה לחיי אדם, ייצוב מהיר, ותקשורת רציפה.",
                "בצעו עכשיו: 1) הבטחת זירה בטוחה, 2) טריאז' וייצוב, 3) חיוג לחירום/לווין, 4) שיתוף מיקום מדויק, 5) תיעוד זמן ותסמינים."
            )
        }

        return (
            "Emergency command mode engaged: prioritize life safety, rapid stabilization, and communication continuity.",
            "Execute now: 1) secure scene safety, 2) triage and stabilize, 3) call emergency services/satellite SOS, 4) share exact location, 5) log time and symptoms."
        )
    }

    private static func loadModel() -> LocalReasoningModelPayload {
        if let data = defaultLocalReasoningModelJSON.data(using: .utf8),
           let decoded = try? JSONDecoder().decode(LocalReasoningModelPayload.self, from: data),
           decoded.labels.count == decoded.logPriors.count,
           decoded.labels.count == decoded.logLikelihoods.count,
           decoded.nextActions.count == decoded.labels.count,
           decoded.labelBriefs.count == decoded.labels.count
        {
            return decoded
        }

        return fallbackModel()
    }

